member.remarks:
The interesting part in the following method is the support for exception filters. 
=== Example:

try
{
   TryBlock
}
catch (ExceptionType ex) if (Condition)
{
   Handler
}

gets emitted as something like ===>

Try           
    TryBlock
Filter 
    var tmp = Pop() as {ExceptionType}
    if (tmp == null)
    {
        Push 0
    }
    else
    {
        ex = tmp
        Push Condition ? 1 : 0
    }
End Filter // leaves 1 or 0 on the stack
Catch      // gets called after finalization of nested exception frames if condition above produced 1
    Pop    // CLR pushes the exception object again
    variable ex can be used here
    Handler
EndCatch

member.summary:
Gets the available base type members in the context of the specified location.  Akin to
calling  with the container set to the immediate base type of
the type in which  occurs.  However, the accessibility rules
are different: protected members of the base type will be visible.

Consider the following example:

  public class Base
  {
      protected void M() { }
  }

  public class Derived : Base
  {
      void Test(Base b)
      {
          b.M(); // Error - cannot access protected member.
          base.M();
      }
  }

Protected members of an instance of another type are only accessible if the instance is known
to be "this" instance (as indicated by the "base" keyword).

The incremental binder is used when binding statements. Whenever a statement
is bound, it checks the bound node cache to see if that statement was bound, 
and returns it instead of rebinding it. 

For example, we might have:
   while (x > foo())
   {
     y = y * x;
     z = z + y;
   }

We might first get semantic info about "z", and thus bind just the statement
"z = z + y". Later, we might bind the entire While block. While binding the while
block, we can reuse the binding we did of "z = z + y".

Smallest location of the template, actually contains the smallest location 
of all the anonymous type instances created using this template during EMIT;

NOTE: if this property is queried, smallest location must not be null.

Given a SynthesizedExplicitImplementationMethod (effectively a tuple (interface method, implementing method, implementing type)),
construct a BoundBlock body.  Consider the tuple (Interface.Foo, Base.Foo, Derived).  The generated method will look like:

R Interface.Foo<T1, T2, ...>(A1 a1, A2 a2, ...)
{
    //don't return the output if the return type is void
    return this.Foo<T1, T2, ...>(a1, a2, ...);
}

Symbol representing a using alias appearing in a compilation unit or within a namespace
declaration. Generally speaking, these symbols do not appear in the set of symbols reachable
from the unnamed namespace declaration.  In other words, when a using alias is used in a
program, it acts as a transparent alias, and the symbol to which it is an alias is used in
the symbol table.  For example, in the source code

namespace NS
{
    using o = System.Object;
    partial class C : o {}
    partial class C : object {}
    partial class C : System.Object {}
}

all three declarations for class C are equivalent and result in the same symbol table object
for C. However, these using alias symbols do appear in the results of certain SemanticModel
APIs. Specifically, for the base clause of the first of C's class declarations, the
following APIs may produce a result that contains an AliasSymbol:

    SemanticInfo SemanticModel.GetSemanticInfo(ExpressionSyntax expression);
    SemanticInfo SemanticModel.BindExpression(CSharpSyntaxNode location, ExpressionSyntax expression);
    SemanticInfo SemanticModel.BindType(CSharpSyntaxNode location, ExpressionSyntax type);
    SemanticInfo SemanticModel.BindNamespaceOrType(CSharpSyntaxNode location, ExpressionSyntax type);

Also, the following are affected if container==null (and, for the latter, when arity==null
or arity==0):

    IList<string> SemanticModel.LookupNames(CSharpSyntaxNode location, NamespaceOrTypeSymbol container = null, LookupOptions options = LookupOptions.Default, List<string> result = null);
    IList<Symbol> SemanticModel.LookupSymbols(CSharpSyntaxNode location, NamespaceOrTypeSymbol container = null, string name = null, int? arity = null, LookupOptions options = LookupOptions.Default, List<Symbol> results = null);

IsManagedType is simple for most named types:
    enums are not managed;
    non-enum, non-struct named types are managed;
    generic types and their nested types are managed;
    type parameters are managed;
    all special types have spec'd values (basically, (non-string) primitives) are not managed;

Only structs are complicated, because the definition is recursive.  A struct type is managed
if one of its instance fields is managed.  Unfortunately, this can result in infinite recursion.
If the closure is finite, and we don't find anything definitely managed, then we return true.
If the closure is infinite, we disregard all but a representative of any expanding cycle.

Intuitively, this will only return true if there's a specific type we can point to that is would
be managed even if it had no fields.  e.g. struct S { S s; } is not managed, but struct S { S s; object o; }
is because we can point to object.

A structure used to lexically order symbols. For performance, it's important that this be 
a STRUCTURE, and be able to be returned from a symbol without doing any additional allocations (even
if nothing is cached yet.)

There are two key reasons why interface overriding/hiding is different from class overriding/hiding: 1) interface members never override other members; and 2) interfaces can extend multiple interfaces. The first difference doesn't require any special handling - as long as the members have IsOverride=false, the code for class overriding/hiding does the right thing. The second difference is more problematic. For one thing, an interface member can hide a different member in each base interface. We only report the first one, but we need to expose all of them in the API. More importantly, multiple inheritance raises the possibility of diamond inheritance. Spec section 13.2.5, Interface member access, says: "The intuitive rule for hiding in multiple-inheritance interfaces is simply this: If a member is hidden in any access path, it is hidden in all access paths." For example, consider the following interfaces:
interface I0 { void M(); } interface I1 : I0 { void M(); } interface I2 : I0, I1 { void M(); }
I2.M does not hide I0.M, because it is already hidden by I1.M. To make this work, we need to traverse the graph of ancestor interfaces in topological order and flag ones later in the enumeration that are hidden along some path.

members.member:
Type parameters in documentation comments are complicated since they sort of act as declarations, rather than references. Consider the following example:
/// <summary>See <see cref="B{U}.M(U)" />.</summary> class B<T> { void M(T t) { } }
We make some key observations: 1) The type parameter name in the cref is not tied to the type parameter name in the type declaration. 2) A relationship exists between the two occurrences of "U" in the cref: they both refer to (or define) the same symbol.
In Roslyn, we've decided on the following representation: within the (entire) scope of a cref, the names of all type parameters "declared" in the cref are in scope and bind to the corresponding type parameters. This representation has one major advantage: as long as the appropriate binder (i.e. the one that knows about the implicitly-declared type parameters) is used, TypeSyntaxes within the cref can be bound by calling BindType. In addition to eliminating the necessity for custom binding code in the batch case, this reduces the problem of exposing such nodes in the SemanticModel to one of ensuring that the right enclosing binder is chosen. That is, new code will have to be written to handle CrefSyntaxes, but the existing code for TypeSyntaxes should just work!
In the example above, this means that, between the cref quotation marks, the name "U" binds to an implicitly declared type parameter, whether it is in "B{U}", "M{U}", or "M{List{U[]}}".
Of course, it's not all gravy. One thing we're giving up by using this representation is the ability to distinguish between "declared" type parameters with the same name. Consider the following example:
<summary>See <see cref=""A{T, T}.M(T)""/>.</summary> class A<T, U> { void M(T t) { } void M(U u) { } }
The native compiler interprets this in the same way as it would interpret A{T1, T2}.M(T2) and unambiguously (i.e. without a warning) binds to A{T, U}.M(U). Since Roslyn does not distinguish between the T's, Roslyn reports an ambiguity warning and picks the first method. Furthermore, renaming one 'T' will rename all of them.
This class represents such an implicitly declared type parameter. The declaring syntax is expected to be an IdentifierNameSyntax in the type argument list of a QualifiedNameSyntax.

