Lowers a lock statement to a try-finally block that calls Monitor.Enter and Monitor.Exit
before and after the body, respectively.

C# 4.0 version

L locked;
bool flag = false;
try {
    locked = `argument`;
    Monitor.Enter(locked, ref flag);
    `body`
} finally {
    if (flag) Monitor.Exit(locked);
}

Pre-4.0 version

L locked = `argument`;
Monitor.Enter(locked, ref flag);
try {
    `body`
} finally {
    Monitor.Exit(locked);
}
